import React from 'react'
import {Link} from 'react-router-dom'

class AddAuthor extends React.Component{
    render(){
        return <div>
            <h1>Add Author</h1>
            <p>{JSON.stringify(this.props.match)}</p>
            <Link to="/">Go to Home Page</Link>
        </div>;
    }
}

export default AddAuthor;
